import Header from './header';
import Footer from './footer';
import styles from '../screens/CSS/home.module.css';
import * as React from 'react';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import { Tabs, AppBar } from '@mui/material';
import { Typography } from '@mui/material';

function TabPanel(props) {
    const { children, value, index, ...other } = props;
  
    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`vertical-tabpanel-${index}`}
        aria-labelledby={`vertical-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box sx={{ p: 3 }}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }

function ProductManager({navigation}){
    const [value, setValue] = React.useState('1');

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    return(
        <div className={styles.Home}>
            <Header navigation={navigation}/>
            <div className={styles.content} >
                <div className={styles.wraper}>
                    <p className={styles.tdisplay}> Thong tin san pham </p>
                    <div>
                    <Tabs
                    value={value}
                    onChange={handleChange}
                    textColor="secondary"
                    indicatorColor="secondary"
                    aria-label="secondary tabs example"
                    orientation="vertical"
                    >
                        <Tab value="one" label="Item One"  id={0}/>
                        <Tab value="two" label="Item Two" id={1}/>
                        <Tab value="three" label="Item Three" id={2}/>
                    </Tabs>
                    <TabPanel value={value} index={0}>
                        Item One 4
                    </TabPanel>
                    <TabPanel value={value} index={1}>
                        Item Two 4
                    </TabPanel>
                    <TabPanel value={value} index={2}>
                        Item Three 4
                    </TabPanel>
                </div> 
                </div>
            </div>
            <Footer navigation={navigation}/>
      </div>
    );
}

export default ProductManager;
